import React from "react";

class Header extends React.Component {
  render() {
    return (
      <div className="header flex">
        <div className="grid">
          <div className="start flex">
            <a href="/">
              Home
              <img src="" alt="" />
            </a>
            <p>蕨鹿逢生</p>
          </div>
          <div className="end flex">
            <a href="/">Login</a>
            <a href="/">Register</a>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
